import React from 'react';
import {SingleActivity} from './Components'

const Activities = ({activities}) => {
    return activities ?
        <>
            <div>
                <div>Activities:</div>
                {
                    activities.map(activity => <SingleActivity key = {activity.id} activity = {activity} />)
                }
            </div>

        </>
        : 'Rendering...'
};

export default Activities;
